import React from 'react'
//import { useMyQueryQuery } from '../utils/__generated__/graphql'
import {Spinner} from "react-bootstrap";
import { useQuery} from '@apollo/client';
import {TestQuery,ThisUser} from '../api/queries';

export const Page = () => {
  const {loading, data, error} = useQuery(ThisUser(1));

  return (
  <>
    <h2>not poo</h2>
    {
      loading ?
      <Spinner animation="border"/> : !error ? 
      data.user.map(({ ID,Username,date_of_birth, password}:{ID: number,Username: string, date_of_birth: Date,password: string}) => (
        <div key={ID}>
          <h3>{Username}</h3>
          <br />
          <b>About this location:</b>
          <p>{password}</p>
          <br />
        </div>
      )) : <h1> ERROR - MyQuery</h1>
    }
    
    <h3>after poo</h3>
    <Spinner animation="grow" size="sm" />
  </>
  );
}
